Вспыльчивый, но отходчивый; Добрый, но расчетливый;
Доверчивый, но внимательный;
Веселый и серьезный...
Вообщем такой, какой есть...Девушки не пишите и не подмигивайте без фото...Это не потому, что я заносчивый, это потому, что не люблю общаться с "невидимками"

НЕ ПИШИТЕ БЕЗ ФОТО!

И ещё, я здесь не ради поиска новых отношений, а ради общения с интересными и адекватными людьми! Мне не нужна девочка, она у меня есть и я с ней счастлив...просто, не стоит тратить время!
